import { makeStyles } from '@material-ui/core/styles';
import { AvRepeat } from 'material-ui/svg-icons';

export const useStyles = makeStyles({
  card: {
    maxWidth: 224
  },
  media: {
    height: 224,
    width: 224
  },
  container: {
    justifyContent: 'center',
    display: 'grid',
    gridRowGap: 20,
    gridTemplateColumns: AVRepeat(auto - fit, 224),
    margin: 10
  }
});
